wp_estate_custom_css:
/*status*/
#topbarregister {
    display: none;
}


.page-template-blog_list #search_wrapper {
    bottom: 20%;
}

.newsletter_input {
    background: #61c9cd;
}


/*home page heading*/

.is_half_map.header_wrapper.header_type1.header_align_left #access {
    margin: 0px 270px 0px 220px;
}

.logged-in #access ul {
    margin: 0 0 0 -.8125em;
}

#access ul {
    margin-left: 0px;
    margin-right: auto;
}

.header_wrapper.header_type1.header_align_left #access {
    margin: 0 270px 0 230px;
    text-align: right;
    padding-top: 0;
    height: 100%;
}

.heading_over_image_wrapper {
    top: 40%;
}

.subheading_over_image {
    font-size: 20px;
}

/*adv search*/

.adv_handler {
    display: none;
}

.adv-search-4 {
    padding: 10px 10px 5px 10px;
}

.adv-search-4 .col-md-2:nth-of-type(2) {
    display: none;
}

#search_wrapper {
    max-width: 900px;
    left: 0px;
    right: 0px;
    margin: 0 auto;
}

#search_wrapper_color {
    max-width: 900px;
    left: 0px;
    right: 0px;
    margin: 0 auto;
}

#advanced_submit_4{
    width:100%;
}

 .adv-search-4 .col-md-2:nth-of-type(4), 
 .home .adv-search-4 .col-md-2:nth-of-type(3) {
    width: 25%;
}
